import React from 'react';
import {
  Button,
  Frame,
  Toolbar,
  Window,
  WindowContent,
  WindowHeader
} from 'react95';


export default () => {
  return (
    <>
      <Window style={{width: '500px'}} resizable className='window'>
        <WindowHeader style={{
          display: 'flex',
          justifyContent: 'space-between'
        }}>
          <span>react95.exe</span>
          <Button style={{marginTop: '2px'}}>
            <b>x</b>
          </Button>
        </WindowHeader>
        <WindowContent>
          <p>
            When you set &quot;resizable&quot; prop, there will be drag handle
            in the bottom right corner (but resizing itself must be handled by
            you tho!)
          </p>
        </WindowContent>
      </Window>

    </>
  );
}
